itud, mantener, desarrollar y controlar la relación comercial o contractual, así como para remitirle la información solicitada sobre nuestros\\r\\n productos y servicios. Los datos serán conservados mientras sean necesarios para cumplir con la finalidad pretendida, mientras ninguna de las partes se oponga a ello o durante el período necesario para cumplir con las obligaciones legales. Se garantiza un\\r\\n tratamiento de datos leal y transparente. No se prevén cesiones o comunicaciones de datos salvo en los casos en que exista una obligación legal.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003eLe informamos que los derechos de acceso, rectificación, supresión, limitación de tratamiento, u oposición al tratamiento, así como el derecho a la portabilidad de los datos podrán ser ejercitados ante el Responsable del tratamiento\\r\\n por cualquier medio sujeto en derecho, acompañado de copia de documento oficial que le identifique dirigiéndose a: CALLE AUTONOMÍA, 26, 1ª PLANTA - 48010 BILBAO (BIZKAIA) o enviando un mensaje al correo electrónico\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"mailto:hola@techfriendly.es\\\" id\\u003d\\\"m_-3919935762142429254OWAd33f4f8c-b53e-0713-0632-ce186a8c8fb4\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\"\\u003ehola@techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e,\\r\\n según los términos que la normativa aplicable establece. Puede consultar la información adicional y detallada sobre Protección de Datos en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.techfriendly.es/\\\" id\\u00 t,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003cb\\u003eAVISO LEGAL:\\u003c/b\\u003e Este mensaje y sus archivos adjuntos van dirigidos exclusivamente a su destinatario, pudiendo contener información confidencial sometida a secreto profesional. No está permitida su comunicación, reproducción o distribución sin la autorización\\r\\n expresa de TECHFRIENDLY S.L., si usted no es el destinatario final, por favor elimínelo e infórmenos por esta vía.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n\\u003cb\\u003ePROTECCIÓN DE DATOS:\\u003c/b\\u003e En cumplimiento de lo dispuesto en el artículo 13 del Reglamento (UE) 2016/679 del Parlamento Europeo y del Consejo de 27 de abril de 2016, relativo a la protección de las personas físicas en lo que respecta al tratamiento de datos\\r\\n personales y a la libre circulación de estos (RGPD) y la Ley Orgánica 3/2018, de 5 de diciembre, de Protección de Datos Personales y Garantía de los Derechos Digitales (LOPDGDD), le informamos que los datos personales recabados del propio interesado, serán\\r\\n tratados por TECHFRIENDLY S.L. como responsable del tratamiento, con la finalidad de atender su correspondiente solicitud, mantener, desarrollar y controlar la relación comercial o contractual, así como para remitirle la información solicitada sobre nuestros\\r\\n productos y servicios. Los datos serán conservados mientras sean necesarios para cumplir con la finalidad pretendida, mientras ninguna de las partes se oponga a ello o durante el período necesario para cumplir con las obligaciones legales. Se garantiza un\\r\\n tratamiento de datos leal y transparente. No se prevén cesiones o comunicaciones de datos salvo en los casos en que exista una obligación legal.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003eLe informamos que los derechos de acceso, rectificación, supresión, limitación de tratamiento, u oposición al tratamiento, así como el derecho a la portabilidad de los datos podrán ser ejercitados ante el Responsable del tratamiento\\r\\n por cualquier medio sujeto en derecho, acompañado de copia de documento oficial que le identifique dirigiéndose a: CALLE AUTONOMÍA, 26, 1ª PLANTA - 48010 BILBAO (BIZKAIA) o enviando un mensaje al correo electrónico\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"mailto:hola@techfriendly.es\\\" id\\u003d\\\"m_-3919935762142429254OWAf23c71f5-f446-e84a-ea98-bbdec660fd8b\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\"\\u003ehola@techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e,\\r\\n según los términos que la normativa aplicable establece. Puede consultar la información adicional y detallada sobre Protección de Datos en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.techfriendly.es/\\\" id\\u003d\\\"m_-3919935762142429254OWA6d39cc8a-9e8e-bdcd-f723-4bd81fc9b85b\\\" e\\u003d\\\"color:rgb(0,0,0)\\\"\\u003eLe informamos que los derechos de acceso, rectificación, supresión, limitación de tratamiento, u oposición al tratamiento, así como el derecho a la portabilidad de los datos podrán ser ejercitados ante el Responsable del tratamiento\\r\\n por cualquier medio sujeto en derecho, acompañado de copia de documento oficial que le identifique dirigiéndose a: CALLE AUTONOMÍA, 26, 1ª PLANTA - 48010 BILBAO (BIZKAIA) o enviando un mensaje al correo electrónico\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"mailto:hola@techfriendly.es\\\" id\\u003d\\\"m_-3919935762142429254OWAb3f691a3-5e2b-684e-9b38-d08546747600\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\"\\u003ehola@techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e,\\r\\n según los términos que la normativa aplicable establece. Puede consultar la información adicional y detallada sobre Protección de Datos en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.techfriendly.es/\\\" id\\u003d\\\"m_-3919935762142429254OWAeab976e5-9fc1-f8cc-c5c9-58822b607e64\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttp://www.techfriendly.es/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1744309041069000\\u0026amp;usg\\u003dAOvVaw07o2xvhuuvR4dqJsYaGC6s\\\"\\u003ewww.techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e.\\r\\n Si considera que el tratamiento no se ajusta a la normativa vigente, podrá presentar una reclamación ante la autoridad de control (Agencia Española de Protección de Datos) en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.agpd.es/\\\" id\\u003d\\ bución sin la autorización\\r\\n expresa de TECHFRIENDLY S.L., si usted no es el destinatario final, por favor elimínelo e infórmenos por esta vía.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n\\u003cb\\u003ePROTECCIÓN DE DATOS:\\u003c/b\\u003e En cumplimiento de lo dispuesto en el artículo 13 del Reglamento (UE) 2016/679 del Parlamento Europeo y del Consejo de 27 de abril de 2016, relativo a la protección de las personas físicas en lo que respecta al tratamiento de datos\\r\\n personales y a la libre circulación de estos (RGPD) y la Ley Orgánica 3/2018, de 5 de diciembre, de Protección de Datos Personales y Garantía de los Derechos Digitales (LOPDGDD), le informamos que los datos personales recabados del propio interesado, serán\\r\\n tratados por TECHFRIENDLY S.L. como responsable del tratamiento, con la finalidad de atender su correspondiente solicitud, mantener, desarrollar y controlar la relación comercial o contractual, así como para remitirle la información solicitada sobre nuestros\\r\\n productos y servicios. Los datos serán conservados mientras sean necesarios para cumplir con la finalidad pretendida, mientras ninguna de las partes se oponga a ello o durante el período necesario para cumplir con las obligaciones legales. Se garantiza un\\r\\n tratamiento de datos leal y transparente. No se prevén cesiones o comunicaciones de datos salvo en los casos en que exista una obligación legal.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003eLe informamos que los derechos de acceso, rectificación, supresión, limitación de tratamiento, u oposición al tratamiento, así como el derecho a la portabilidad de los datos podrán ser ejercitados ante el Responsable del tratamiento\\r\\n por cualquier medio sujeto en derecho, acompañado de copia de documento oficial que le identifique dirigiéndose a: CALLE AUTONOMÍA, 26, 1ª PLANTA - 48010 BILBAO (BIZKAIA) o enviando un mensaje al correo electrónico\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"mailto:hola@techfriendly.es\\\" id\\u003d\\\"m_-3919935762142429254OWAaad3fffb-acf7-22e5-7d5b-db89d00085f1\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\"\\u003ehola@techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e,\\r\\n según los términos que la normativa aplicable establece. Puede consultar la información adicional y detallada sobre Protección de Datos en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.techfriendly.es/\\\" id\\u003d\\\"m_-3919935762142429254OWA28feb3b4-02f2-1b7f-b50c-a692b3d8a38f\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttp://www.techfriendly.es/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1744309041069000\\u0026amp;usg\\u003dAOvVaw07o2xvhuuvR4dqJsYaGC6s\\\"\\u003ewww.techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e.\\r\\n Si considera que el tratamiento no se ajusta a la normativa vigente, podrá presentar una reclamación ante la autoridad de control (Agencia Española de Protección de Datos) en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.agpd.es/\\\" id\\u003d\\\"m_-3919935762142429254OWAd6e95840-fb29-18e3-30ba-a1255a535999\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u00 \n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n\\u003cb\\u003ePROTECCIÓN DE DATOS:\\u003c/b\\u003e En cumplimiento de lo dispuesto en el artículo 13 del Reglamento (UE) 2016/679 del Parlamento Europeo y del Consejo de 27 de abril de 2016, relativo a la protección de las personas físicas en lo que respecta al tratamiento de datos\\r\\n personales y a la libre circulación de estos (RGPD) y la Ley Orgánica 3/2018, de 5 de diciembre, de Protección de Datos Personales y Garantía de los Derechos Digitales (LOPDGDD), le informamos que los datos personales recabados del propio interesado, serán\\r\\n tratados por TECHFRIENDLY S.L. como responsable del tratamiento, con la finalidad de atender su correspondiente solicitud, mantener, desarrollar y controlar la relación comercial o contractual, así como para remitirle la información solicitada sobre nuestros\\r\\n productos y servicios. Los datos serán conservados mientras sean necesarios para cumplir con la finalidad pretendida, mientras ninguna de las partes se oponga a ello o durante el período necesario para cumplir con las obligaciones legales. Se garantiza un\\r\\n tratamiento de datos leal y transparente. No se prevén cesiones o comunicaciones de datos salvo en los casos en que exista una obligación legal.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003eLe informamos que los derechos de acceso, rectificación, supresión, limitación de tratamiento, u oposición al tratamiento, así como el derecho a la portabilidad de los datos podrán ser ejercitados ante el Responsable del tratamiento\\r\\n por cualquier medio sujeto en derecho, acompañado de copia de documento oficial que le identifique dirigiéndose a: CALLE AUTONOMÍA, 26, 1ª PLANTA - 48010 BILBAO (BIZKAIA) o enviando un mensaje al correo electrónico\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"mailto:hola@techfriendly.es\\\" id\\u003d\\\"m_-3919935762142429254OWAd7f13594-2b14-1445-2dfe-37467c224537\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\"\\u003ehola@techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e,\\r\\n según los términos que la normativa aplicable establece. Puede consultar la información adicional y detallada sobre Protección de Datos en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.techfriendly.es/\\\" id\\u003d\\\"m_-3919935762142429254OWA11dc490b-a2b6-7d23-1c2a-bdafa39d698e\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttp://www.techfriendly.es/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1744309041070000\\u0026amp;usg\\u003dAOvVaw1cXN-uGHs3BKW_KVIFUYeS\\\"\\u003ewww.techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e.\\r\\n Si considera que el tratamiento no se ajusta a la normativa vigente, podrá presentar una reclamación ante la autoridad de control (Agencia Española de Protección de Datos) en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.agpd.es/\\\" id\\u003d\\\"m_-3919935762142429254OWA7786cb8c-7bdb-7e66-bdc2-70eefb80a52b\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttp://www.agpd.es/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1744309041070000\ o (UE) 2016/679 del Parlamento Europeo y del Consejo de 27 de abril de 2016, relativo a la protección de las personas físicas en lo que respecta al tratamiento de datos\\r\\n personales y a la libre circulación de estos (RGPD) y la Ley Orgánica 3/2018, de 5 de diciembre, de Protección de Datos Personales y Garantía de los Derechos Digitales (LOPDGDD), le informamos que los datos personales recabados del propio interesado, serán\\r\\n tratados por TECHFRIENDLY S.L. como responsable del tratamiento, con la finalidad de atender su correspondiente solicitud, mantener, desarrollar y controlar la relación comercial o contractual, así como para remitirle la información solicitada sobre nuestros\\r\\n productos y servicios. Los datos serán conservados mientras sean necesarios para cumplir con la finalidad pretendida, mientras ninguna de las partes se oponga a ello o durante el período necesario para cumplir con las obligaciones legales. Se garantiza un\\r\\n tratamiento de datos leal y transparente. No se prevén cesiones o comunicaciones de datos salvo en los casos en que exista una obligación legal.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003eLe informamos que los derechos de acceso, rectificación, supresión, limitación de tratamiento, u oposición al tratamiento, así como el derecho a la portabilidad de los datos podrán ser ejercitados ante el Responsable del tratamiento\\r\\n por cualquier medio sujeto en derecho, acompañado de copia de documento oficial que le identifique dirigiéndose a: CALLE AUTONOMÍA, 26, 1ª PLANTA - 48010 BILBAO (BIZKAIA) o enviando un mensaje al correo electrónico\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"mailto:hola@techfriendly.es\\\" id\\u003d\\ m;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n\\u003cb\\u003ePROTECCIÓN DE DATOS:\\u003c/b\\u003e En cumplimiento de lo dispuesto en el artículo 13 del Reglamento (UE) 2016/679 del Parlamento Europeo y del Consejo de 27 de abril de 2016, relativo a la protección de las personas físicas en lo que respecta al tratamiento de datos\\r\\n personales y a la libre circulación de estos (RGPD) y la Ley Orgánica 3/2018, de 5 de diciembre, de Protección de Datos Personales y Garantía de los Derechos Digitales (LOPDGDD), le informamos que los datos personales recabados del propio interesado, serán\\r\\n tratados por TECHFRIENDLY S.L. como responsable del tratamiento, con la finalidad de atender su correspondiente solicitud, mantener, desarrollar y controlar la relación comercial o contractual, así como para remitirle la información solicitada sobre nuestros\\r\\n productos y servicios. Los datos serán conservados mientras sean necesarios para cumplir con la finalidad pretendida, mientras ninguna de las partes se oponga a ello o durante el período necesario para cumplir con las obligaciones legales. Se garantiza un\\r\\n tratamiento de datos leal y transparente. No se prevén cesiones o comunicaciones de datos salvo en los casos en que exista una obligación legal.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003eLe informamos que los derechos de acceso, rectificación, supresión, limitación de tratamiento, u oposición al tratamiento, así como el derecho a la portabilidad de los datos podrán ser ejercitados ante el Responsable del tratamiento\\r\\n por cualquier medio sujeto en derecho, acompañado de copia de documento oficial que le identifique dirigiéndose a os_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003cb\\u003eAVISO LEGAL:\\u003c/b\\u003e Este mensaje y sus archivos adjuntos van dirigidos exclusivamente a su destinatario, pudiendo contener información confidencial sometida a secreto profesional. No está permitida su comunicación, reproducción o distribución sin la autorización\\r\\n expresa de TECHFRIENDLY S.L., si usted no es el destinatario final, por favor elimínelo e infórmenos por esta vía.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n\\u003cb\\u003ePROTECCIÓN DE DATOS:\\u003c/b\\u003e En cumplimiento de lo dispuesto en el artículo 13 del Reglamento (UE) 2016/679 del Parlamento Europeo y del Consejo de 27 de abril de 2016, relativo a la protección de las personas físicas en lo que respecta al tratamiento de datos\\r\\n personales y a la libre circulación de estos (RGPD) y la Ley Orgánica 3/2018, de 5 de diciembre, de Protección de Datos Personales y Garantía de los Derechos Digitales (LOPDGDD), le informamos que los datos personales recabados del propio interesado, serán\\r\\n tratados por TECHFRIENDLY S.L. como responsable del tratamiento, con la finalidad de atender su correspondiente solicitud, mantener, desarrollar y controlar la relación comercial o contractual, así como para remitirle la información solicitada sobre nuestros\\r\\n productos y servicios. Los datos serán conservados mientras sean necesarios para cumplir con la finalidad pretendida, mientras ninguna de las partes se oponga a ello o durante el período necesario para cumplir con las obligaciones legales. Se garantiza un\\r\\n tratamiento de datos leal y transparente. No se prevén cesiones o comunicaciones de datos salvo en los casos en que exista una obligación legal.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003eLe informamos que los derechos de acceso, rectificación, supresión, limitación de tratamiento, u oposición al tratamiento, así como el derecho a la portabilidad de los datos podrán ser ejercitados ante el Responsable del tratamiento\\r\\n por cualquier medio sujeto en derecho, acompañado de copia de documento oficial que le identifique dirigiéndose a: CALLE AUTONOMÍA, 26, 1ª PLANTA - 48010 BILBAO (BIZKAIA) o enviando un mensaje al correo electrónico\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"mailto:hola@techfriendly.es\\\" id\\u003d\\\"m_7762512258526515114m_-5386463724882234229OWAb3f691a3-5e2b-684e-9b38-d08546747600\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\"\\u003ehola@techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e,\\r\\n según los términos que la normativa aplicable establece. Puede consultar la información adicional y detallada sobre Protección de Datos en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.techfriendly.es/\\\" id\\u003d\\\"m_7762512258526515114m_-5386463724882234229OWAeab976e5-9fc1-f8cc-c5c9-58822b607e64\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttp://www.techfriendly.es/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1744309041115000\\u0026amp;usg\\u003dAOvVaw1dYAqTZvhKiZ83i2OhniCk\\\"\\u003ewww.techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e.\\r\\n Si considera que el tratamiento no se ajusta a la normativa vigente, podrá presentar una reclamación ante la autoridad de control (Agencia Española de Protección de Datos) en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.agpd.es/\\\" id\\u003d\\\"m_7762512258526515114m_-5386463724882234229OWAb43f1014-6dae-6346-5e85-b816bfca8e4a\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttp://www.agpd.es/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1744309041115000\\u0026amp;usg\\u003dAOvVaw1jZlmopLjn-YoXym8C2eYX\\\"\\u003ewww.agpd.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e.\\u003c/span\\u003e\\u003c/div\\u003e\\r\\n\\u003c/div\\u003e\\r\\n\\u003cdiv id\\u003d\\\"m_7762512258526515114m_-5386463724882234229x_x_appendonsend\\\"\\u003e\\u003c/div\\u003e\\r\\n\\u003chr style\\u003d\\\"direction:ltr;disp ibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n \\u003cb\\u003eAVISO LEGAL:\\u003c/b\\u003e Este mensaje y sus archivos adjuntos van dirigidos exclusivamente a su destinatario, pudiendo contener información confidencial sometida a secreto profesional. No está permitida su comunicación, reproducción o distribución sin la autorización\\r\\n expresa de TECHFRIENDLY S.L., si usted no es el destinatario final, por favor elimínelo e infórmenos por esta vía.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n\\u003cb\\u003ePROTECCIÓN DE DATOS:\\u003c/b\\u003e En cumplimiento de lo dispuesto en el artículo 13 del Reglamento (UE) 2016/679 del Parlamento Europeo y del Consejo de 27 de abril de 2016, relativo a la protección de las personas físicas en lo que respecta al tratamiento de datos\\r\\n personales y a la libre circulación de estos (RGPD) y la Ley Orgánica 3/2018, de 5 de diciembre, de Protección de Datos Personales y Garantía de los Derechos Digitales (LOPDGDD), le informamos que los datos personales recabados del propio interesado, serán\\r\\n tratados por TECHFRIENDLY S.L. como responsable del tratamiento, con la finalidad de atender su correspondiente solicitud, mantener, desarrollar y controlar la relación comercial o contractual, así como para remitirle la información solicitada sobre nuestros\\r\\n productos y servicios. Los datos serán conservados mientras sean necesarios para cumplir con la finalidad pretendida, mientras ninguna de las partes se oponga a ello o durante el período necesario para cumplir con las obligaciones legales. Se garantiza un\\r\\n tratamiento de datos leal y transparente. No se prevén cesiones o comunicaciones de datos salvo en los casos en que exista una obligación legal.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003eLe informamos que los derechos de acceso, rectificación, supresión, limitación de tratamiento, u oposición al tratamiento, así como el derecho a la portabilidad de los datos podrán ser ejercitados ante el Responsable del tratamiento\\r\\n por cualquier medio sujeto en derecho, acompañado de copia de documento oficial que le identifique dirigiéndose a: CALLE AUTONOMÍA, 26, 1ª PLANTA - 48010 BILBAO (BIZKAIA) o enviando un mensaje al correo electrónico\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003 ión. No haga clic en enlaces ni abra archivos adjuntos a menos que reconozca al remitente y sepa que el contenido\\r\\n es seguro.\\u003c/span\\u003e\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003e\\u003cbr\\u003e\\r\\n\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003eBuenas Victor,\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003e\\u003cbr\\u003e\\r\\n\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003eMe he conectado y no veo error en los contadores. Solo he visto dos cosas.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003e\\u003cbr\\u003e\\r\\n\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003e1.- Se estaban actualizando los contadores cada 30 minutos, lo he cambiado para que lo hagan cada minuto.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003e\\u003cbr\\u003e\\r\\n\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003e2.- Justo ahora que me he conectado tenían la barrera de salida bloqueada arriba por lo tanto no se contabilizan esas salidas y los datos pueden ser totalmente ficticios.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003e\\u003cbr\\u003e\\r\\n\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003eSeguimos en contacto.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003e\\u003cbr\\u003e\\r\\n\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003eUn saludo.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003e\\u003cbr\\u003e\\r\\n\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"direction:ltr\\\"\\u003eEl lun, 31 mar 2025 a las 12:50, Victor Salguero (\\u0026lt;\\u003ca href\\u003d\\\"mailto:victor@techfriendly.es\\\" id\\u003d\\\"m_7762512258526515114m_-5386463724882234229OWA510ac064-e8ce-cef7-4101-652ac5140709\\\" target\\u003d\\\"_blank\\\"\\u003ev as sean necesarios para cumplir con la finalidad pretendida, mientras ninguna de las partes se oponga a ello o durante el período necesario para cumplir con las obligaciones legales. Se garantiza un\\r\\n tratamiento de datos leal y transparente. No se prevén cesiones o comunicaciones de datos salvo en los casos en que exista una obligación legal.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003eLe informamos que los derechos de acceso, rectificación, supresión, limitación de tratamiento, u oposición al tratamiento, así como el derecho a la portabilidad de los datos podrán ser ejercitados ante el Responsable del tratamiento\\r\\n por cualquier medio sujeto en derecho, acompañado de copia de documento oficial que le identifique dirigiéndose a: CALLE AUTONOMÍA, 26, 1ª PLANTA - 48010 BILBAO (BIZKAIA) o enviando un mensaje al correo electrónico\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"mailto:hola@techfriendly.es\\\" id\\u003d\\\"m_7762512258526515114m_-5386463724882234229OWAd67e9a98-8a21-3c6f-6e53-6c848da65a1c\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\"\\u003ehola@techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e,\\r\\n según los términos que la normativa aplicable establece. Puede consultar la información adicional y detallada sobre Protección de Datos en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.techfriendly.es/\\\" id\\u003d\\\"m_7762512258526515114m_-5386463724882234229OWA9f13ccd9-33a0-075d-94d0-cca35b59b59e\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\" data-safered u003c/b\\u003e Este mensaje y sus archivos adjuntos van dirigidos exclusivamente a su destinatario, pudiendo contener información confidencial sometida a secreto profesional. No está permitida su comunicación, reproducción o distribución sin la autorización\\r\\n expresa de TECHFRIENDLY S.L., si usted no es el destinatario final, por favor elimínelo e infórmenos por esta vía.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt;color:rgb(0,0,0)\\\"\\u003e\\r\\n\\u003cb\\u003ePROTECCIÓN DE DATOS:\\u003c/b\\u003e En cumplimiento de lo dispuesto en el artículo 13 del Reglamento (UE) 2016/679 del Parlamento Europeo y del Consejo de 27 de abril de 2016, relativo a la protección de las personas físicas en lo que respecta al tratamiento de datos\\r\\n personales y a la libre circulación de estos (RGPD) y la Ley Orgánica 3/2018, de 5 de diciembre, de Protección de Datos Personales y Garantía de los Derechos Digitales (LOPDGDD), le informamos que los datos personales recabados del propio interesado, serán\\r\\n tratados por TECHFRIENDLY S.L. como responsable del tratamiento, con la finalidad de atender su correspondiente solicitud, mantener, desarrollar y controlar la relación comercial o contractual, así como para remitirle la información solicitada sobre nuestros\\r\\n productos y servicios. Los datos serán conservados mientras sean necesarios para cumplir con la finalidad pretendida, mientras ninguna de las partes se oponga a ello o durante el período necesario para cumplir con las obligaciones legales. Se garantiza un\\r\\n tratamiento de datos leal y transparente. No se prevén cesiones o comunicaciones de datos salvo en los casos en que exista una obligación legal.\\u003c/div\\u003e\\r\\n\\u003cdiv style\\u003d\\\"text-align:left;text-indent:0px;margin-top:1em;margin-bottom:1em;font-family:Aptos,Aptos_EmbeddedFont,Aptos_MSFontService,Calibri,Helvetica,sans-serif;font-size:12pt\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003eLe informamos que los derechos de acceso, rectificación, supresión, limitación de tratamiento, u oposición al tratamiento, así como el derecho a la portabilidad de los datos podrán ser ejercitados ante el Responsable del tratamiento\\r\\n por cualquier medio sujeto en derecho, acompañado de copia de documento oficial que le identifique dirigiéndose a: CALLE AUTONOMÍA, 26, 1ª PLANTA - 48010 BILBAO (BIZKAIA) o enviando un mensaje al correo electrónico\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"mailto:hola@techfriendly.es\\\" id\\u003d\\\"m_7762512258526515114m_-5386463724882234229OWAd7f13594-2b14-1445-2dfe-37467c224537\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\"\\u003ehola@techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e,\\r\\n según los términos que la normativa aplicable establece. Puede consultar la información adicional y detallada sobre Protección de Datos en\\r\\n\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(5,99,193)\\\"\\u003e\\u003ca href\\u003d\\\"http://www.techfriendly.es/\\\" id\\u003d\\\"m_7762512258526515114m_-5386463724882234229OWA11dc490b-a2b6-7d23-1c2a-bdafa39d698e\\\" style\\u003d\\\"color:rgb(5,99,193);margin:0px\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttp://www.techfriendly.es/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1744309041116000\\u0026amp;usg\\u003dAOvVaw2lG3kqJ-pX-IP9yJOW_zAU\\\"\\u003ewww.techfriendly.es\\u003c/a\\u003e\\u003c/span\\u003e\\u003cspan style\\u003d\\\"color:rgb(0,0,0)\\\"\\u003e.\\r\\n Si considera que el tratamiento no se ajusta a la normativa vigente, podrá presentar una reclamación ante la autoridad de control (Agencia Española de Protección de Datos) e
